<!DOCTYPE html>
<html>

<head>
    <title>Certificate</title>
    <style>
        body {
            font-family: 'Times New Roman', Times, serif;
        }

        .certificate {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            text-align: center;
            padding: 50px;
            border: 4mm ridge rgba(4, 176, 0, .6);
            border-radius: 10px;
            margin: 20px;
            width: 100vw;
            /* height: 6rem; */
            background-color: #f2f1ee;
        }

        .certificate h1 {
            font-size: 30px;
            margin-bottom: 2rem;
        }

        .certificate p {
            font-size: 18px;
        }

        .certificate .name {
            font-size: 30px;
            font-weight: bolder;
            padding-bottom: 1.2rem;
            border-bottom: 2.5px solid;
            margin-bottom: 1.3rem;
            font-family: Arial, Helvetica, sans-serif;
        }



        .certificate .date {
            font-size: 18px;
            margin-top: 20px;
        }

        .certificate .footer {
            position: relative;
            height: 8rem;
            width: 100%;
            margin-top: 3rem;
        }

        .certificate .caption {
            font-style: italic;
        }

        .certificate .caption .emphasize {
            font-style: normal;
            font-size: 18px;
        }

        .certificate .emphasize {
            font-size: 22px;
            font-weight: bold;
            font-family: Arial, Helvetica, sans-serif;
        }

        .certificate .footer .emphasize {
            font-size: 18px;
        }

        .certificate .logo {
            position: fixed;
        }

        .certificate .logo img {
            height: 4rem;
        }

        .certificate .date {
            position: absolute;
            left: 4rem;
        }

        .certificate .agency {
            position: absolute;
            right: 4rem;
        }
    </style>
</head>

<body>
    <div class="certificate">
        <div class="logo">
            <img src="data:image/png;base64," alt="">
        </div>
        <h1>Certificate of Completion</h1>
        <p class="caption">This certificate is presented to</p>
        <p class="name user">{{$user->userInfo->name}}</p>
        <p class="caption">who has successfully completed the training program, entitled:</p>
        <p class="emphasize">"{{$trainingProgram->title}}"</p>
        <p class="caption">on <span class="emphasize">{{\Carbon\Carbon::parse($trainingProgram->end)->format('F j, Y')}}</span></p>
        <div class="footer">
            <div class="date">
                <p class="emphasize">{{ \Carbon\Carbon::now()->format('F j, Y') }}</p>
                <p class="">Date of Certification</p>
            </div>
            <div class="agency">
                <p class="emphasize">{{$trainingProgram->agency->userInfo->name}}</p>
                <p class="">Training Agency</p>
            </div>
        </div>
    </div>
</body>

</html>